import { Route, Routes } from "react-router-dom";
import {Commands} from "./pages/commands"
import { Menu } from "./pages/menu";

function App() {


  return (
    <div className="App">
      {/* <h1>Comander</h1>
      <hr /> */}
      <Routes>
        <Route path="commands" element={<Commands />} />
        <Route path="menu" element={<Menu />} />
      </Routes>
    </div>
  );
}

export default App;
